import instagram from '../../assets/instagram.png';

const Footer = () => {
    return (
        <div className="footer">
            <h4>HeliBuy corp. 2023</h4>
            <div className='icons'>
                <div className="icon"> <img src={instagram} alt="Instagram Icon" /> </div>
            </div>
            <h4>www.helibuy.org</h4>

        </div>
    )
}
export default Footer
